script: |
  super -f text -I q8303.spq | sort > q8303.out

inputs:
  - name: q8303.spq
    data: |
      SELECT ALL + col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - 37 NOT BETWEEN - col0 * - ( + col0 ) + col0 + - col0 / - + col2 * + + 86 * col2 AND NULL;
  - name: tab1

outputs:
  - name: q8303.out
    data: |
